	 ('False',NULL,0,'[{"id": 53, "name": "Thriller"}, {"id": 27, "name": "Horror"}, {"id": 878, "name": "Science Fiction"}]',NULL,224815,'tt2881698','en','Skinwalker Ranch','In  2010 “Skinwalker Ranch” gained media attention after experiencing a wide range of unexplained phenomena. Reports ranged from UFO sightings to livestock mutilation, but maybe most notable was the disappearance of ranch owner Hoyt Miller’s eight-year-old son Cody on November 11, 2010. Close to a year later, Modern Defense Enterprises has sent a team of experts to document and investigate the mysterious occurrences, which only escalate upon their arrival. Tensions rise as the team must decide how far they will go to unlock the mysteries of “Skinwalker Ranch.” The group debates whether the answers are worth risking their lives for, or if they should just call off the investigation and leave the ranch—that is, if leaving is actually an option…','[-0.0017046276,-0.015903074,0.0039486303,-0.012619333,-0.018644048,0.019159677,-0.010014052,-0.01744996,-0.011710199,-0.0115134455,0.0032990058,0.018331956,-0.03061206,-0.013358853,0.015875936,0.0338958,0.016920762,-0.021208622,0.019702442,-0.007469831,-0.0048102727,0.010007267,-0.019621028,0.0026850007,0.00662515,-0.0012212258,0.021507144,-0.024220979,0.01094354,-0.01972958,-0.012721102,-0.01119457,-0.020747269,-0.00034537792,-0.03110055,-0.010285435,0.012829656,-0.014451172,0.007469831,-0.020679424,0.025889987,0.002517082,-0.024383808,-0.016662948,-0.0007005087,-0.0035110242,0.01860334,-0.02057087,-0.03451998,0.008066875,0.022565538,0.00070941343,-0.0041521676,-0.044126958,0.015183907,-0.017911311,-0.0021795488,0.015699536,0.029743632,-0.029228004,0.015753813,-0.024546638,-0.012944994,0.008894594,-0.024112426,0.0107874945,-0.01152023,0.008467166,-0.0054412396,-0.0038502535,0.038292214,0.022524832,-0.0003659437,-0.024736607,0.03897067,-0.008806395,0.0040605757,0.009688391,0.022117756,0.013019624,0.013202808,-0.020326626,-0.0084061045,0.039784823,0.02362393