	 ('False',NULL,176199,'[{"id": 35, "name": "Comedy"}, {"id": 18, "name": "Drama"}, {"id": 14, "name": "Fantasy"}]',NULL,224946,'tt1754228','en','Motivational Growth','Ian Folivor, a depressed and reclusive 30-something, finds himself taking advice from a growth in his bathroom after a failed suicide attempt. The Mold, a smooth talking fungus who was born of the filth collecting in a corner of Ian''s neglected bathroom, works to win Ian''s trust by helping him clean himself up and remodel his lifestyle. With The Mold''s help, Ian attracts the attention of a neighbor he''s been ogling through his peephole, Leah, and he manages to find a slice of happiness despite his unnatural circumstances. But Ian starts to receive strange messages from his old and broken down TV set that make him realize that The Mold may not be as helpful as it seems to be, and strange characters combined with stranger events cast Ian''s life in the shadow of an epic battle between good and evil that Ian is only partially aware of.','[0.016427686,-0.0069419364,-0.00036839288,-0.00521482,-0.0128730405,0.016882896,-0.01595909,-0.04742206,-0.0152762765,0.006145321,0.028169401,-0.00811343,-0.009612942,0.010503277,-0.0182753,-0.00017802519,0.03272149,0.0011187764,0.0009187857,-0.008227232,-0.0182753,0.029829575,-0.0018124679,-0.0023597227,-0.008595415,0.0047964295,0.009231369,-0.023095159,0.012725768,-0.0014308958,0.0039629955,-0.03162363,-0.004903537,-0.01542355,-0.022974662,-0.008481613,0.005184696,0.00089368224,0.0017455254,-0.0140847005,0.012672214,-0.013127422,-0.008153595,-0.010101622,-0.036336385,-0.0011765143,-0.013120729,-0.008876574,0.004009855,0.006848217,0.042762864,0.004003161,0.029615358,-0.019841755,0.0030073915,-0.017230997,0.022680115,0.0018107943,0.013642879,-0.0068348283,-0.0009648086,-0.019841755,-0.024849052,0.008936822,-5.8731577e-05,0.023510203,-0.01952043,-0.013508995,-0.02371103,-0.0021505274,0.028945932,0.043218073,0.0035345636,-0.004086839,0.027392868,-0.013803542,-0.0250900